INSERT INTO `departaments` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Neurologjia', 'Departamenti Neurologjik ofron kujdes të specializuar për trajtimin dhe menaxhimin e çrregullimeve të sistemit nervor, duke përdorur teknologjinë më të avancuar për diagnostikim dhe trajtim. ', '2024-12-06 13:53:52', '2024-12-08 14:48:15'),
(9, 'Oftamologu', 'Departamenti ynë i oftalmologjisë ofron shërbime të avancuara për diagnostikimin dhe trajtimin e sëmundjeve të syrit, përmes teknologjive të fundit dhe kujdesit të specializuar.', '2024-12-08 13:06:26', '2024-12-08 13:06:26'),
(10, 'Kirurgjia', 'Departamenti Kirurgjik ofron një gamë të gjerë shërbimesh kirurgjikale për trajtimin e pacientëve me nevoja të ndryshme. Ne përdorim teknologji moderne dhe metoda të avancuara për të siguruar kujdesin më të lartë për pacientët tanë, përfshirë ndërhyrje kirurgjikale të planifikuara dhe urgjente. ', '2024-12-08 13:13:36', '2024-12-20 04:41:28');
